export const actionTypes = {
    GET_ALL_HOME_CATEGORY_REQUEST: 'GET_ALL_HOME_CATEGORY_REQUEST',
    GET_ALL_HOME_CATEGORY_SUCCESS: 'GET_ALL_HOME_CATEGORY_SUCCESS',
    GET_INACTIVE_HOME_CATEGORY_REQUEST: 'GET_INACTIVE_HOME_CATEGORY_REQUEST',
    GET_INACTIVE_HOME_CATEGORY_SUCCESS: 'GET_INACTIVE_HOME_CATEGORY_SUCCESS'
};

export function getAllHomeCategory(payload) {
    return { type: actionTypes.GET_ALL_HOME_CATEGORY_REQUEST, payload };
}

export function getAllHomeCategorySuccess(payload) {
    return { type: actionTypes.GET_ALL_HOME_CATEGORY_SUCCESS, payload };
}

export function getInactiveHomeCategory(payload) {
    return { type: actionTypes.GET_INACTIVE_HOME_CATEGORY_REQUEST, payload };
}

export function getInactiveHomeCategorySuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_HOME_CATEGORY_SUCCESS, payload };
}
